import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";



const Footer = () => {
    return (
        <Router>
            <Link to="/all">All</Link>
            <Link to="/active">Active</Link>
            <Link to="/complete">Home</Link>
        </Router>

    )
}

export default Footer
